import React from 'react';
import './CircularProgress.css';

const CircularProgress = ({ totalTasks, completedTasks }) => {
    const percentage = totalTasks > 0 ? (completedTasks / totalTasks) * 100 : 0;

    return (
        <div className="circular-progress" style={{ width: '120px', height: '120px' }}>
            <svg>
                <circle cx="60" cy="60" r="54" stroke="#e6e6e6" strokeWidth="12" fill="none" />
                <circle
                    cx="60"
                    cy="60"
                    r="54"
                    stroke="#4caf50"
                    strokeWidth="12"
                    fill="none"
                    strokeDasharray={`${percentage}, 100`}
                    transform="rotate(-90 60 60)"
                />
            </svg>
            <div className="percentage">{Math.round(percentage)}%</div>
        </div>
    );
};
export default CircularProgress;
